%% Symbolic solution
% \theta = [H D Tpd0 Tppd0 Tppq0 Xd Ra Xppd Xpd Xl Xq Xpq Xppq];
syms Ks H Dt Tpd0 Tppd0 Tppq0 Xd Ra SE Xppd Xpd Xl Xq Xppq omega  %%Parameters
syms P_0 id_0 iq_0%%s  
syms Psippq Psikd Epq

 
% To reduce the sine/cosine terms:
 delta = 0;

% To include the sine/cosine terms:
% syms delta

% Definition of constants 
K1 = (Xpd-Xppd)*(Xd-Xpd) / (Xpd-Xl)^2;
K3 = (Xppd-Xl)/(Xpd-Xl);
K4 = (Xpd-Xppd)/(Xpd-Xl);
omega = 2*50*pi; %omega = 2*\pi*f
Ks = 0; % Since we are looking at the machine only and no network, this term is zero


ud = (-Psippq) - Xppq*iq_0 - Ra*id_0;
uq = Epq*K3 + Psikd*K4 - Xppd*id_0 - Ra*iq_0;

% Defining inputs, outputs, and states:
% x  = [\omega, \delta, Epq, \Psi_{kd}, \Psi_{ppq}]
% y = [Vd, Vq, Ifd, \omega]
% u = [Id, Iq, Efd]
% \theta = [H D Tpd0 Tppd0 Tppq0 Xd Ra Xppd Xpd Xl Xq Xpq Xppq];

% The saturation function is linearized to a constant SE
A = [-(Dt+P_0)/(2*H)   -Ks/(2*H)    0               0           0;
    omega                   0       0               0           0;
    0                       0       (SE+1+K1)/Tpd0  K1/Tpd0     0;
    0                       0       1/Tppd0         -1/Tppd0    0;
    0                       0       0               0           -1/Tppq0];
% A = [-(Dt+P_0)/(2*H)   0           -(K3*id_0)/(2*H)                -(K4*id_0)/(2*H)        iq_0/(2*H);
%     omega              0           0                                0                      0;
%     0                  0           (SE+1+K1)/Tpd0                   K1/Tpd0                0;
%     0                  0           1/Tppd0                          -1/Tppd0               0;
%     0                  0           0                                0                      -1/Tppq0];

B = [0                                      0               0;
     0                                      0               0;
     (-K1*(Xpd-Xl)+(Xd-Xpd))/Tpd0           0               1/Tpd0;
     (Xpd-Xl)/Tppd0                         0               0;
     0                                     (Xq-Xppq)/Tppq0  0;];

C =[ 0      0       K3          K4      0;
     0      0       -(K1+SE+1) -K1      0;
     0      1       0           0       0;];


D = [-Xppq                -Ra     0;
    -K1*(Xpd-Xl)-(Xpd-Xd)  0      0;
    0                      0      0;];
% Machine initial conditions
syms V_0 

Vr = V_0*cos(delta);
Vi = V_0*sin(delta);
% Translate P and Q to Ir and Ii
% P = VrIr + ViIi
% Q = ViIr - VrIi
IrIi = -([Vr Vi; Vi -Vr]); 
% Translate Ir and Ii to Id and Iq 
IdIq = -(([sin(delta), cos(delta); -cos(delta), sin(delta)])); 

u_ch = inv(IrIi*IdIq); % change the input from [Id; Iq]; to [P;Q];

C1 = [sin(delta), cos(delta); -cos(delta), sin(delta)]*C(1:2,:)
C2 = sqrt(C1(1,:).^2+C1(2,:).^2)
C = [C2;C(3:4,:)]

B1 = [B(2:5,1:2) * -u_ch];
B = [-1/(2*H) 0 0;  %% Electric power from swing equations
    B1, B(2:5,3)];  %% Translation from the IqId inputs
D1 = [D(:,1:2) * u_ch];
D = [D1, D(:,3)];

% Now that we have translated everything, our states and IOs are:
% x = [\omega, \delta, Epq, \Psi_{kd}, \Psi_{ppq}]
% y = [Vt, Ifd, \omega]
% u = [P, Q, Efd]
% \theta = [H D Tpd0 Tppd0 Tppq0 Xd Ra Xppd Xpd Xl Xq Xpq Xppq];


% State space to transfer function
syms s
I = eye(5);
tf = C*inv(s*I-A)*B + D;
%%
% Determine the gradient of the operator G(theta):
% Each term labeled in_out where: in = [P,Q,Efd], out = [Vt,Ifd, w]
% P_Vt = gradient(tf(1,1),s);
% P_Ifd = gradient(tf(2,1),s);
% P_w = gradient(tf(3,1),s);
% 
% Q_Vt = gradient(tf(1,2),s);
% Q_Ifd = gradient(tf(2,2),s);
% Q_w = gradient(tf(3,2),s);
% 
% Efd_Vt = gradient(tf(1,3),s);
% Efd_Ifd = gradient(tf(2,3),s);
% Efd_w = gradient(tf(3,3),s);
% 
% dGds = [P_Vt, P_Ifd, P_w;
%         Q_Vt, Q_Ifd, Q_w;
%         Efd_Vt, Efd_Ifd, Efd_w;];
%%
% Determine the gradient of the operator G(theta):
% Each term labeled in_out where: in = [P,Q,Efd], out = [Vt,Ifd, w]
theta = [H Dt Tpd0 Tppd0 Tppq0 Xd Ra Xppd Xpd Xl Xq Xppq]; % Dt is the damping, I just used the variable D in the state space

P_Vt = gradient(tf(1,1),theta);
P_Ifd = gradient(tf(2,1),theta);
P_w = gradient(tf(3,1),theta);

Q_Vt = gradient(tf(1,2),theta);
Q_Ifd = gradient(tf(2,2),theta);
Q_w = gradient(tf(3,2),theta);

Efd_Vt = gradient(tf(1,3),theta);
Efd_Ifd = gradient(tf(2,3),theta);
Efd_w = gradient(tf(3,3),theta);

dGdtheta = [P_Vt, P_Ifd, P_w, Q_Vt, Q_Ifd, Q_w, Efd_Vt, Efd_Ifd, Efd_w]
%% Numerical solution, using the parameters:
% \theta = [H D Tpd0 Tppd0 Tppq0 Xd Ra Xppd Xpd Xl Xq Xpq Xppq]:
    Xd=1.183;
    Ra=0.017637/(10.5^2/30);
    H=2.137;
    Xpd=0.371;
    Dt=0;
    Xq=0.62;
    Xppd=0.215;
    Xppq=0.241;
    Tpd0=3.77;
    Tppd0= 0.0552;
    Tppq0=0.0823;
    Xl=0.1;
    V_0=1.001;
    A_0=0;
    P_0= 0.6063;
    Q_0= 0.005;
    id_0 = 0.20745;
    iq_0 = 0.565695;
    psikd_0 = 0.97;
    psippq_0 = 0.2135;
    CoB = 3/10;
% Definition of constants 
K1 = (Xpd-Xppd)*(Xd-Xpd) / (Xpd-Xl)^2;
K3 = (Xppd-Xl)/(Xpd-Xl);
K4 = (Xpd-Xppd)/(Xpd-Xl);

omega = 2*50*pi;
Ks = 0;

% I picked the saturation term to be at initialization of my simulation to
% match the result of the linearization I got from Dymola
SE = -7.2833;
% Defining inputs, outputs, and states:
% x  = [\omega, \delta, Epq, \Psi_{kd}, \Psi_{ppq}]
% y = [Vd, Vq, Ifd, \omega]
% u = [Id, Iq, Efd]
% \theta = [H D Tpd0 Tppd0 Tppq0 Xd Ra Xppd Xpd Xl Xq Xpq Xppq]:

A = [-(Dt+P_0)/(2*H)   -Ks/(2*H)    0               0           0;
    omega                   0       0               0           0;
    0                       0       (SE+1+K1)/Tpd0  K1/Tpd0     0;
    0                       0       1/Tppd0         -1/Tppd0    0;
    0                       0       0               0           -1/Tppq0];

% A = [-(Dt+P_0)/(2*H)   0           -(K3*id_0)/(2*H)                -(K4*id_0)/(2*H)        iq_0/(2*H);
%     omega              0           0                                0                      0;
%     0                  0           (SE+1+K1)/Tpd0                   K1/Tpd0                0;
%     0                  0           1/Tppd0                          -1/Tppd0               0;
%     0                  0           0                                0                      -1/Tppq0];

B = [-psikd_0*K4/(2*H)                      psippq_0        0;
     0                                      0               0;
     (K1*(Xpd-Xl)-(Xd-Xpd))/Tpd0            0               1/Tpd0;
     -(Xpd-Xl)/Tppd0                        0               0;
     0                                     (Xq-Xppq)/Tppq0  0;];

C = [0      0       0           0       1
     0      0       K3          K4      0;
     0      0       -(K1+SE+1) -K1      0;
     0      1       0           0       0;];

D = [-Xppd                -Ra     0;
    -K1*(Xpd-Xl)-(Xpd-Xd)  0      0;
    0                      0      0;];
% Machine initial conditions (from my simulation)
V_0 = 1.0886;
delta = 30.453;

Vr = V_0*cosd(delta);
Vi = V_0*sind(delta);
% Translate P and Q to Ir and Ii
% P = VrIr + ViIi
% Q = ViIr - VrIi
IrIi = -([Vr Vi; Vi -Vr]); 

IdIq = -(([sind(delta), cosd(delta); -cosd(delta), sind(delta)])); % Translate Ir and Ii to Id and Iq 

u_ch = inv(IrIi*IdIq); % change the input from [Id; Iq]; to [P;Q];

C1 = [sin(delta), cos(delta); -cos(delta), sin(delta)]*C(1:2,:);
C2 = sqrt(C1(1,:).^2+C1(2,:).^2);
C = [C2;C(3:4,:)];

B1 = [B(2:5,1:2) * -u_ch];
B = [-1/(2*H) 0 0;  %% Electric power from swing equations
    B1, B(2:5,3)];  %% Translation from the IqId inputs
D1 = [D(:,1:2) * u_ch];
D = [D1, D(:,3)];

% Now that we have translated everything, our states and IOs are:
% x = [\omega, \delta, Epq, \Psi_{kd}, \Psi_{ppq}]
% y = [Vt, Ifd, \omega]
% u = [P, Q, Efd]
% \theta = [H D Tpd0 Tppd0 Tppq0 Xd Ra Xppd Xpd Xl Xq Xpq Xppq]:

sys=ss(A,B,C,D);
figure(1); bode(sys)


